r faro de valores, conocimiento, salud y seguridad, generando un crculo de valores bsicos como el respeto, la honestidad, la tolerancia, la cooperacin; as como de conciencia histrica retomando personajes que fueron participes de cambios o de luchas sociales en favor de igualdades y derechos dentro de la comunidad.','2018-04-25 02:59:26',1,'caran@dees.mx','Caran Soluciones Estratgicas',50,50,194),(181,'FORMANDO UNA NUEVA GENERACION DE NIOS  SANOS EN XOCHIMILCO','A consecuecia de una mala alimentacion, la poblacion infantil de xochimilco ha incrementado las enfermedades cronico degenerativas, cardiovasculares, como hipertencion arterial, diabetes, retraso en el crecimiento, deficiencia de atencion escolar, entre otras','En buscar del Bienestar Social , uno de los aspectos  primordiales  del ser humano es la salud de sus habitantes. Si tenemos  ciudadanos sanos, tendremos un buen inicio para alcanzar el bienestar social  ','Disminuir la mala alimentacion infantil,  de 2 a 6 aos en 4 barrios de Xochimilco','2018-04-27 17:22:35',1,'caran@dees.mx','Campesinos  Unidos en Defensa del Campo, A.C.',10,10,195),(182,'Rumbo a la visualizacin de los Derechos de las nias, nios y adolesentes ','Alto indice de nias, nios y adolescentes que acuden al Hospital Peditrico de Iztapalapa por abuso sexual. ','deficiencias en el servicio de salud, en  la atencin y prevencin del abuso sexual en nias, nios y adolescentes','Disminuir el indice de abuso sexual en nias, nios y adolescentes que acuden al Hospital Peditrico Iztapalapa ','2018-04-27 18:21:39',1,'caran@dees.mx','Consultores Independientes',6,2,196),(183,'Drogadiccin en escuelas pblicas en Iztapalapa','Drogadiccin','Por multiplesmotivos de los cuales los ms importantes son la desintegracin familiar y el alto indice de drogadiccin.','Reducir el ndice de drogadiccin en escuelas pblicas de Iztapalapa','2018-04-27 18:45:33',1,'caran@dees.mx','Molecular Genomic Pharma',1500,1500,197),(184,'Prevencin del embarazo adolescente en mujeres indgenas','Baja cultura de prevencin de embarazo en mujeres adolescentes indgenas de 12 a 17 aos en las escuelas de nivel secundaria del municipio de san juan lalana.','El Estado de Oaxaca se encuentra entre los estados de mayor indice de marginacin a nivel nacional, desercin escolar, alta poblacin indgena; dentro de los municipios de alta marginacon se encuentra San juan Lalana, con una alta poblacin hablante de su lengua indigena, predoniminantemente el  chinanteco, con dificil acceso a los servicios bsicos como la salud y educacin; siendo la poblacin prioritaria (nios, nias y adolescentes) siendo las adolescentes las mas desfavorecidos, aumentando el riesgo de desercin escolar y sobretodo riesgo de embarazo adolescente, ya que al no contar con informacin adecuada y acceso a los medios de prevencin del embarazo, se ven afectadas por este hecho',' Generar una cultura de prevencin de embarazo adolescente  en el municipio de san juan lalana, choapam, oaxaca.','2018-04-27 20:52:23',1,'caran@dees.mx','EMPODERAMIENTO Y DESARROLLO DE MUJERES Y COMUNIDADES INDGENAS A.C.',200,80,198),(185,'Inteligencia = Cerebro + Corazn','Los estudiantes de la secundaria tcnica No. 10 de La Paz, Baja California Sur; no afrontan sus problemticas interpersonales de manera efectiva y esto replica diferentes tipos de violencia ','La comunidad estudiantil no cuenta con herramientas y metodologas de desarrollo de inteligencia emocional','Desarrollar la inteligencia emocional en los estudiantes de la secundaria tcnica No. 10, para mejorar la convivencia escolar y prevenir los casos y expresiones de violencia.','2018-10-03 23:33:53',1,'','Ensea por Mxico',41,40,199),(186,'Yo resuelvo, no violento','Alto nmero de conflictos interpersonales, familiares y en la localidad no son resueltos de manera efectiva.','8 de cada 10 conflictos presentados en la localidad son por un mal manejo de la situacin.','Impulsar los mecanismos de resolucin de conflictos a trves de la mediacin y sus herramientas.','2018-10-